function About() {
  return (
    <div className="about">
      <h2>About</h2>

      <p>The study intake system was designed to empower government agencies and not-for-profits around the country to conduct their own research to better understand the needs and preferences of their respective constituents. By implementing this study intake system, these organizations can streamline the process of tracking client outcomes, making data collection more efficient and accessible. This system can be tailored to accommodate various research objectives, allowing agencies to gather insights on topics such as public health, education, social services, and more. Furthermore, the collected data can be automatically analyzed and visualized, providing these community-focused entities with valuable and actionable insights. Ultimately, this tool empowers agencies and non-profits to make informed decisions, allocate resources effectively, and design initiatives that are aligned with the specific requirements and desires of the communities they serve. As a result, the study intake system not only simplifies the research process but also enhances the overall impact of community-driven projects. </p>

      <p>The site is inteded for demonstration purposes only.</p>
    </div>
  )
}

export default About
